import React from "react";
import uniqid from "uniqid";

export default function CharacterCard({ loading, characters }) {
  const randomNumberArray = [...Array(10)]
    .fill()
    .map((x) => Math.ceil(Math.random() * 75) + 1);

  return loading ? (
    <h1>Loading...</h1>
  ) : (
    <div>
      {characters.map((char) => {
        return <h1>{char.character.name}</h1>;
      })}
    </div>
  );
}
